window.bookSummaryJSON = "<p><b>It's just sex. That's what our contract says, at least.</b></p> <p>After getting royally screwed over by one too many online dates, it's perfect. I'm done with relationships.</p> <p>The night I run into Easton, my ex's best friend, and then Vincent, everything changes. They offer everything I want and more.</p> <p>I sign on the dotted line and am thrown into a world of spankings, restraints, and demands for my submission by Easton, the one I shouldn't want, and Vincent, the man who likes when I call him daddy.</p> <p>I'm completely at their mercy. They command my body, but my heart follows their demands for trust, too.</p> <p>The lines of our contract are getting blurry. The farther they push me, the more I wish I could burn each page and make it disappear.</p> <p>Because this isn't just about sex anymore.</p> <p>I want them to be mine, but do they want the same thing?</p> <p>Ours <i>is an MMF romance for mature listeners.</i></p>"; 
